// https://dog.ceo/api/breeds/image/random/4

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      floor2Img: []
    }
  }

  componentDidMount() {
    fetch('https://fronteupp2.cube-net.pub/fr/ajax/nfs/int/sport-categories/padel')
    .then(res => res.json())
    .then((data)=> console.log(data))
    .then((data) => {
      this.setState({ floor2Img: data.data.articles.images.media })
    })
  }

//   componentDidMount() {
//     axios.get('https://dog.ceo/api/breeds/image/random/')
//     .then(response => this.setState({ floor2Img: response.data.message }));
// }

  render(){
    const floor2ImgList = this.state.floor2Img.map((url) => {
      return url
    })

    return (
      <div className="App">
        <Floor1 />
        <Floor2 url={floor2ImgList}/>
        <Floor3 />
      </div>
    );
  }
}

export default App;
